import { getWindowWidth, getWindowHeight } from '../components/window/window_dimensions';
import { Scroll } from 'framer';
//import BgScroll from '../components/home/bg_scroll/bg_scroll'

const BgScroll = dynamic(
    () => import('../components/home/bg_scroll/bg_scroll').then((mod) => mod.BgScroll),
    { ssr: false }
  );


export default function Main() {
    return ( 
        <div>
            <BgScroll></BgScroll>
        </div>
    )
  }
